DROP TABLE IF EXISTS `app_admin`;
CREATE TABLE `app_admin` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `adminname` varchar(255) DEFAULT NULL,
  `password` varchar(255) DEFAULT NULL,
  `gid` int(11) DEFAULT '0',
  `shell` tinyint(5) DEFAULT NULL COMMENT '设置添加、删除、修改等权限',
  `c_path` varchar(255) DEFAULT NULL COMMENT '存放栏目的id',
  `logintime` varchar(50) DEFAULT NULL,
  `f_path` varchar(255) DEFAULT NULL,
  `qid` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=79 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

