-- ----------------------------
--  Table structure for `app_article`
-- ----------------------------
DROP TABLE IF EXISTS `app_article`;
CREATE TABLE `app_article` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `parentid` int(11) NOT NULL,
  `title` varchar(255) NOT NULL DEFAULT '',
  `bodys` text,
  `num` int(11) NOT NULL DEFAULT '0',
  `dates` varchar(50) DEFAULT NULL,
  `ishome` tinyint(1) NOT NULL DEFAULT '0',
  `isrecom` tinyint(1) NOT NULL DEFAULT '0',
  `image` varchar(255) DEFAULT NULL,
  `source` varchar(255) DEFAULT NULL,
  `viewnum` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `parentid` (`parentid`)
) ENGINE=MyISAM AUTO_INCREMENT=893 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

-- ----------------------------
--  Table structure for `app_attr`
-- ----------------------------
DROP TABLE IF EXISTS `app_attr`;
CREATE TABLE `app_attr` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `pid` int(11) NOT NULL DEFAULT '0' COMMENT '自己的父id',
  `name` varchar(255) DEFAULT NULL COMMENT '属性和值',
  `ftype` char(8) DEFAULT NULL COMMENT '表单类型',
  `cid` int(11) DEFAULT NULL COMMENT '栏目id',
  `num` int(11) NOT NULL DEFAULT '0',
  `type` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `id` (`id`) USING BTREE,
  KEY `pid` (`pid`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=1077 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

